import { State } from './JobOffersUtils';

interface JobOffersAction {
  type: string;
  payload: number;
}

const JobOffersReducer = (state: State, action: JobOffersAction) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default JobOffersReducer;
